import React from "react";
export default class Results extends React.Component {
    constructor(props) {
        super(props)
        console.log("in results");
        console.log(props);
        this.state ={
            data:props.setResults()
        }
    }

    render() {
        return(
            <div>
                {this.state.data.results}
            </div>
        )
    }
}
